import React, { useState } from 'react';
import { IKContext, IKImage, IKUpload } from 'imagekitio-react';


const ImageUpload = () => {
  const [uploadedFileURL, setUploadedFileURL] = useState('');

  const handleFileUpload = (response) => {
    if (response.success) {
      // The uploaded file's URL will be available in the `response.url` property.
      setUploadedFileURL(response.url);
      alert('File uploaded successfully!');
    } else {
      alert('File upload failed. Please try again.');
    }
  };
  

  return (
    <div>
      <IKContext
        publicKey="public_hzGjC6kUjUGsbckeI6CG7BEKQWc="
        urlEndpoint="https://ik.imagekit.io/kntuxq9n5"
        transformationPosition="path"
        authenticationEndpoint="http://localhost:3000/"
      >
        {/* Image component */}
        <IKImage
          path="/body-language.jpg"
          transformation={[{ height: '300', width: '400' }]}
        />

        {/* Image upload */}
        <IKUpload
          fileName="my-upload"
          onError={(error) => console.error('Upload error:', error)}
          onSuccess={handleFileUpload}
        />
      </IKContext>

      {/* Display the uploaded file's URL */}
      {uploadedFileURL && (
        <div>
          <h2>Uploaded File URL:</h2>
          <a href={uploadedFileURL} target="_blank" rel="noopener noreferrer">
            {uploadedFileURL}
          </a>
        </div>
      )}
    </div>
  );
};

export default ImageUpload;
